using System.Collections;using System.Collections.Generic;using UnityEngine;using UnityEditor;namespace InspectorExtension.EditorGUILayouts {	[CustomEditor (typeof (RectField))]	public class RectFieldInspector : Editor {		RectField _target;		void OnEnable () {			_target = (RectField)target;		}		public override void OnInspectorGUI () {			_target.Rect = EditorGUILayout.RectField ("Rect", _target.Rect);			_target.RectInt = EditorGUILayout.RectIntField ("Rect Int", _target.RectInt);		}	}}